(154, 'Logiprof formation', '&lt;p&gt;&lt;b&gt;LOGIPROF FORMATION:&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;font color=&quot;#000000&quot; style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;- Cours d’anglais intensif&lt;/font&gt;&lt;/b&gt; avec un expert interprète et traducteur trilingue. Pour parler couramment l’anglais: débutant,moyen, avancé,voyage, affaire, commercial.&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Logiprof formation vos diplômes ne suffisent plus, votre niveau d’étude ne suffit plus.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#000000&quot; style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;&lt;b&gt;- Cours d’informatique pratique&lt;/b&gt;&lt;/font&gt; avec un expert. word, excel, saari, autocad, archicad,video et photoshop, illustrator,&lt;/p&gt;&lt;p&gt;&lt;b style=&quot;color: rgb(0, 0, 0); background-color: rgb(255, 255, 0);&quot;&gt;- Stages de soutenance&lt;/b&gt;. Bureautique, sécrétariat, comptabilité, gestion, bâtiment, infographie, maintenance et réseau informatique. &lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;i&gt;Tel: 0505945725 / 0789534554&amp;nbsp; &amp;nbsp;&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;', 'logiprof-formation-154', 6, NULL, 'price_on_call', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'professionnel', 2, '2021-07-13 11:28:34', NULL, NULL, 38, NULL),
