(155, 'Formation à domicile en montage video et infographie', '&lt;p&gt;&lt;b&gt;Formation à domicile en montage video et infographie&lt;/b&gt; avec les logiciels première pro{pr}, photoshop{ps}&amp;nbsp; &lt;/p&gt;&lt;p&gt;&lt;a href=&quot;Tel:0787017179&quot; target=&quot;_blank&quot;&gt;Tel: 0787017179&lt;/a&gt; / 0708979820&amp;nbsp;&lt;br&gt;&lt;/p&gt;', 'formation-a-domicile-en-montage-video-et-infographie-155', 6, NULL, 'price_on_call', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'professionnel', 2, '2021-07-13 11:38:27', NULL, NULL, 43, NULL),
(156, 'devenez indépendant grâce à la cryptomonnaie', '&lt;p&gt;Formation apprenez dès aujourd’hui à utiliser les cryptos, recevez tous les rudiments et devenez indépendant grâce à la cryptomonnaie.&lt;/p&gt;&lt;p&gt;&lt;b&gt;&lt;font color=&quot;#000000&quot; style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;Tel: 0141227351&amp;nbsp;&lt;/font&gt;&lt;/b&gt;&lt;br&gt;&lt;/p&gt;', 'devenez-independant-grace-a-la-cryptomonnaie-156', 6, NULL, 'price_on_call', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'particulier', 2, '2021-07-13 11:48:07', NULL, NULL, 40, NULL),
