(158, 'gamme dédiée aux soins des cheveux', '&lt;p&gt;&lt;span style=&quot;color: rgb(5, 5, 5); font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(255, 255, 255);&quot;&gt;Lyma\'s hairs est une gamme dédiée aux soins des cheveux qu\'ils soient frisés, défrisés, crépus ou bouclé. Donnez vie à vos cheveux. &lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-family: &amp;quot;Segoe UI Historic&amp;quot;, &amp;quot;Segoe UI&amp;quot;, Helvetica, Arial, sans-serif; font-size: 15px; white-space: pre-wrap; background-color: rgb(255, 255, 0);&quot;&gt;&lt;font color=&quot;#000000&quot; style=&quot;&quot;&gt;Tel: 0708465161&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'gamme-dediee-aux-soins-des-cheveux-158', 10, NULL, 'price_on_call', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'particulier', 2, '2021-07-13 17:01:08', NULL, NULL, 45, NULL),
