(160, 'ROYAL CAFE', '&lt;p&gt;Royal café est un complément alimentaire qui aide à corriger les dysfonctionnements organiques afin de rétablir l’équilibre physiologie. il corrige: &lt;font color=&quot;#000000&quot; style=&quot;background-color: rgb(255, 255, 0);&quot;&gt;le diabète, l’hypertension, les ulcères, la faiblesse sexuelle, la frigidité à titre préventif et curatif&lt;/font&gt;. &lt;/p&gt;&lt;p&gt;&lt;b&gt;prix:3.000fr la boîte de 100gr&lt;/b&gt;.&lt;/p&gt;&lt;p&gt; tél:0708373170/ 0546754735&lt;br&gt;&lt;/p&gt;', 'royal-cafe-160', 10, NULL, '3000', 'lindice@aventconcept.com', NULL, NULL, 'Abidjan', 'offre', 'professionnel', 2, '2021-07-26 13:40:03', NULL, NULL, 18, NULL),
