(197, 'MERCEDES BLANCHE POUR MARIAGE', '&lt;p class=&quot;MsoNormal&quot;&gt;Belle berline de 5 places, MERCEDES C300 très confortable,\r\nde couleur blanche. Très propre avec climatisation impeccable. Véhicule\r\nsécurisé&amp;nbsp;: verrouillage central, système de freinage ABS…&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Véhicule silencieux, à moindre consommation de carburant, intérieur\r\ncuir, luxueux en location pour vos cérémonies de mariage ou autres courses\r\nprofessionnelles ou de loisirs. &lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;A louer à Abidjan et l’intérieur du pays avec chauffeur\r\nprofessionnel de grande expérience pour vous conduire en toute sécurité.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Prix: 60.000frs Abidjan &amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Tarif négociable pour location longue durée.&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n&lt;/p&gt;&lt;p class=&quot;MsoNormal&quot;&gt;Bureau: Plateau 0707705311 / 0101462444&lt;o:p&gt;&lt;/o:p&gt;&lt;/p&gt;', 'mercedes-blanche-pour-mariage-197', 2, NULL, '60000', 'multipharma2020@gmail.com', 'multipharma2020@gmail.com', '0707705311', 'Abidjan', 'offre', 'professionnel', 1, '2021-09-10 11:19:26', NULL, NULL, 0, NULL),
